import React from 'react'
import  './About.css'
import Ipng from "../assets/images/I.png";

const About = () => {

  return (

    <section className='about'>

        <article class="about-img">
          <img src={Ipng} class="hero-photo"
            alt="about img"
          />


        </article>




  </section>



  )
}

export default About
